import ProductDemo from '../public/video/alcheZoomy_product_demo.mp4';
import ReactPlayer from 'react-player';

const azDemo = () => (
  <div >
    <ReactPlayer 
      src={ProductDemo}
      layout="intrinsic"
            width={312}
            height={300}
    />
  </div>
);

export default azDemo
